  "text" : "\uCF08\uB808\uACE0\uB984 \uC758\uC678\uB85C \uB208\uBB3C\uC774 \uB9CE\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uC5B4\uB9B4 \uB54C\uBD80\uD130\uB3C4 \uCC21\uCC21\uC774\uC600\uACE0 \uCEE4\uC11C\uB3C4 \uC911\uC694\uD55C \uC77C\uC5D0 \uC824 \uBA3C\uC800 \uB208\uBB3C \uBCF4\uC778\uB2E4\uAC70\uB098. \uD398\uC544\uB178\uB974 \uC8FD\uC5C8\uC744 \uB54C\uB3C4 \uAC00\uC7A5 \uB9CE\uC774 \uC6B8\uACE0 \uB9C8\uC5D0\uB4DC\uB85C\uC2A4 \uAD6C\uCD9C\uB410\uC744 \uB54C\uB3C4 \uC6B8\uACE0. \uADFC\uB370 \uCFE0\uB8E8\uD540\uC740 \uAC1C\uCC28\uAC00\uC6C0. \uC2AC\uD514, \uAE30\uC068 \uC18D\uC5D0\uC11C\uB3C4 \uBA38\uB9AC\uAC00 \uB3CC\uC544\uAC08 \uC218 \uC788\uB294.",
